import { createSlice } from "@reduxjs/toolkit";

const songData = {
  chipList: ["Playlists", "Artist", "Albums", "Podcast..."],
  
};

const songsSlice = createSlice({
  name: "songs",
  initialState: {
    data: songData,
  },

  reducers: {
    setProducts(state, action) {},
  },
});

export const { setProducts } = songsSlice.action;
export default songsSlice.reducer;
